import React from 'react';
import styles from './Popup.module.css';

const Popup = () => {
  return (
    <div className={styles.popup}>
      <h2 className={styles.title}>Popup Title</h2>
      <p className={styles.content}>This is a simple popup!</p>
      <button className={styles.button} onClick={() => alert('Popup button clicked')}>Click me</button>
    </div>
  );
}

export default Popup;
